import React from "react";

function App(){
    let time = new Date();
    time = time.getHours();
    greetings = "";
    cssStyle = {};

    if(time>=1 && time<12){
        greetings = "Good Morning";
        cssStyle.color = "green";
    }
    
}
export default App;
